import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question({getquestionid, id}) {

    const q = getquestionid(parseInt(id));
    console.log(q);

    return(
        <Paper>
            <h2>Title: {q.title}</h2>

        </Paper>
    )
}

export default Question;
